import React from 'react'
import { CATEGORIES } from './data'

export default class Container extends React.Component {

  renderCats = () => {
    return this.props.categories.map(cat => <button>{cat}</button>)
  }

  render() {
    return(
      <div className="categories">
        {this.renderCats()}
      </div>
    )
  }
}
